@login_required
def bronze_form(request):
    user = User.objects.all()

    if request.method == 'POST':
        form = BronzeCouponForm(request.POST)
        if form.is_valid():
            coupon = form.save(commit=False)
            coupon.user = request.user

            if coupon.coupon_code in bronzecodes:
                for each in user:
                    if coupon.guider == f'{each.username}' and coupon.guider != f'{request.user}':
                        coupon.is_activated = True
                        coupon.save()
                        messages.success(request, 'Congratulations, Your Bronze account has been activated')
