    coupon3 = GoldCoupon.objects.filter(guider=request.user).count() * 1000 
    coupon4 = DiamondCoupon.objects.filter(guider=request.user).count() * 2000
    coupon5 = UltimateCoupon.objects.filter(guider=request.user).count() * 3000
